import React from "react";
import Hero from "./components/Hero";
import Navbar from "./components/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./components/Login";
import Admin_navbar from "./components/admin/Admin_navbar";
import Admin_dashboard from "./components/admin/Admin_dashboard";
import Admin_view_user from "./components/admin/Admin_view_users";
import Admin_edit_user from "./components/admin/Admin_edit_user"


function App() {
  return (
    <BrowserRouter>
    <div >
      <Routes>
        {/* Nested routing for hero page navbar */}
        <Route path="/" element={<Navbar />}>
          <Route path="" element={<Hero />}/>
          <Route path="/login" element={<Login />} />
        </Route>

        <Route path="/admin" element={<Admin_navbar />}>
          <Route path="" element={<Admin_dashboard />} />
          <Route path="viewuser" element={<Admin_view_users />} />
          <Route path="edituser" element={<Admin_edit_user />} />
        </Route>


      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
